script: |
  super -f text -I q11726.spq | sort > q11726.out

inputs:
  - name: q11726.spq
    data: |
      SELECT ALL col2 AS col2 FROM tab1 (FORMAT parquet) AS cor0 WHERE - col1 / - col2 * 93 NOT IN ( - - col1 + + + col2 * col2 );
  - name: tab1

outputs:
  - name: q11726.out
    data: |
      59
      68
      96
